Here's an example code using Node.js and Express to extract all images from the URL "<a href="http://pornpics.com/tags/{something}" target="_new">http://pornpics.com/tags/{something}</a>" and save them to a local directory:


```javascriptconst express = require('express');
const request = require('request');
const fs = require('fs');

const app = express();

app.get('/', (req, res) => {
  const url = 'http://pornpics.com/tags/{something}';
  request.get(url, (error, response, body) => {
    if (error) {
      res.status(500).send('Error:'+ error);
      } else {
        const images = body.split('images-container\\nimages-');
        images.forEach((image) => {
          const filename = image.split('-')[2];
          const path = `${__dirname}/images/${filename}`;

          fs.writeFile(path, image, (error) => {
            if (error) {
              res.status(500).send('Error:'+ error);
            } else {
              res.send('Image saved to'+ filename);
            }
          });
        });
      }
    }
  });
});

app.listen(3000, () => {
  console.log('Server listening on port 3000');
});
```

In this example, the `` app.get `` function is used to handle GET requests to the server. The `` res.send `` function is used to send a response to the client, and the `` fs.writeFile `` function is used to save the image data to a local file. The `` __dirname `` variable is used to get the current directory, and the `` images.forEach `` loop is used to iterate over the image URLs, split them into filename and image-container parts, and save each image to a local file. The `` res.send `` function is used to send a response to the client when the image is saved, and the `` app.listen `` function is used to start the server on port 3000.
